/**
 * @param {number[]} nums
 * @return {void} Do not return anything, modify nums in-place instead.
 */
var wiggleSort = function(nums) {
    // Not using `const`, `let` will speed up runtime dramatically

    var n = nums.length;
    var midIndex = Math.floor(n / 2);
    findKthSmallest(nums, midIndex);
    var mid = nums[midIndex];

    var i = 0;
    var j = 0;
    var k = n - 1;

    function getIndex(i) {
        return (1 + 2 * i) % (n | 1);
    }

    while (j <= k) {
        if (nums[getIndex(j)] > mid) {
            swap(nums, getIndex(i++), getIndex(j++));
        } else if (nums[getIndex(j)] < mid) {
            swap(nums, getIndex(j), getIndex(k--));
        } else {
            j += 1;
        }
    }
};

/**
 * @param  {number[]} nums
 * @param  {number}   k
 * @return {number}
 */
function findKthSmallest(nums, k) {
    // See 215 Kth Largest Element in an Array

    shuffle(nums);

    var lo = 0;
    var hi = nums.length - 1;

    while (lo < hi) {
        var j = partition(nums, lo, hi);

        if (j < k) {
            lo = j + 1;
        } else if (j > k) {
            hi = j - 1;
        } else {
            break;
        }
    }

    return nums[k];
}

function partition(arr, l, r) {
    var pivot = arr[r];
    for (var i = l; i < r; i += 1) {
        if (arr[i] <= pivot) {
            swap(arr, l, i);
            l += 1;
        }
    }
    swap(arr, l, r);
    return l;
}

function shuffle(arr) {
    var i = arr.length;
    while (i > 0) {
        var random = Math.floor(Math.random() * i);
        i -= 1;
        swap(arr, i, random);
    }
}

function swap(arr, a, b) {
    var tmp = arr[a];
    arr[a] = arr[b];
    arr[b] = tmp;
}


